<!DOCTYPE html>
<html lang="en">

<head>
	<meta charset="utf-8">
	<meta name="viewport" content="width=device-width,initial-scale=1,minimum-scale=1,maximum-scale=1">
	<title>Canva Mini</title>
	<link rel="preconnect" href="https://fonts.googleapis.com">
	<link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
	<link href="https://fonts.googleapis.com/css2?family=Roboto:wght@300;400;500;700&display=swap" rel="stylesheet">
	<link rel="stylesheet" href="assets/css/style.css">
</head>

<body>
	<div class="ss-site-wrapper">
		<header class="ss-site-header ss-navbar">
			<ul class="ss-navbar__nav ss-navbar--right">
				<li class="ss-navbar__item">
					<a data-modal-target="ss-modal" href="javascript:void(0)" class="btn btn-secondary">Log in</a>
				</li>
				<li class="ss-navbar__item">
					<a data-modal-target="ss-modal" href="javascript:void(0)" class="btn btn-primary">Sign up</a>
				</li>
			</ul>
		</header> <!-- /.site-header -->

		<main class="ss-site-content">
			<section id="ss-modal" class="ss-modal">
				<div class="ss-modal__inner">
					<span class="ss-modal__close"><svg width="16" height="16" viewBox="0 0 16 16" fill="none" xmlns="http://www.w3.org/2000/svg">
